import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import ValueChanger from "./ValueChanger";
import Grid from '@mui/material/Unstable_Grid2'; // Grid version 2
import React, { useState } from 'react';

function CollapsibleChanger(props){
    let valueChangerList = [];
    const sendChange = (newValue) => {
        console.log(props.propert + " : " + newValue);
    }
    for(const [property, value] of Object.entries(props.properties)){
        valueChangerList.push(
            <Grid key={property} xs={12}>
                <ValueChanger property={property} value={value} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
        )
    }
    return(
        <h3>{props.property}</h3>
    )
}

export default CollapsibleChanger;
